function HomePage() {
  return (
    <div>
      <a target="_blank" href="/blog">Static Generation with Data example</a> <br /><br />
      <a target="_blank" href="/catchAllRoutes">Catch all routes</a> <br /><br />
      <a target="_blank" href="/posts/2">Post with Id</a> <br /><br />
      <a target="_blank" href="/blueprintComponent">Blueprint library component</a>
    </div>
  );
}

export default HomePage;
